import React, { useState } from 'react';
import './Booking.css';

const Booking = () => {
  const [selectedEvent, setSelectedEvent] = useState('');
  const [ticketQuantity, setTicketQuantity] = useState(1);
  const [ticketPrice, setTicketPrice] = useState(50); // Assuming a default ticket price of $50
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');

  const handleBookingSubmit = (e) => {
    e.preventDefault();
   
    const totalPrice = ticketQuantity * ticketPrice;
    alert(`Booking confirmed for ${name} (${email}) - ${ticketQuantity} tickets for ${selectedEvent}. Total Price: $${totalPrice}`);
  };

  return (
    <div className="booking-container">
      <h1>Book Your Event</h1>
      <form onSubmit={handleBookingSubmit} className="booking-form">
        <div className="form-group">
          <label htmlFor="event">Choose Event:</label>
          <select
            id="event"
            value={selectedEvent}
            onChange={(e) => setSelectedEvent(e.target.value)}
            required
          >
            <option value="">Select an Event</option>
            <option value="Emerging CEO's">Emerging CEO's</option>
            <option value="BTS-Kpop">BTS-Kpop</option>
            <option value="Food festival">Food festival</option>
            <option value="India VS England">India VS England</option>
            <option value="Tech Innovators Summit 2024">Tech Innovators Summit 2024</option>
            <option value="Art & Culture Festival">Art & Culture Festival</option>
            <option value="Indie Music Event">Indie Music Event</option>
            <option value="Hornbill Music Festival">Hornbill Music Festival</option>
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="quantity">Number of Tickets:</label>
          <input
            type="number"
            id="quantity"
            value={ticketQuantity}
            onChange={(e) => setTicketQuantity(e.target.value)}
            min="1"
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="price">Ticket Price:</label>
          <input
            type="number"
            id="price"
            value={ticketPrice}
            onChange={(e) => setTicketPrice(e.target.value)}
            min="1"
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="total-price">Total Price:</label>
          <input
            type="text"
            id="total-price"
            value={`$${ticketQuantity * ticketPrice}`}
            readOnly
          />
        </div>

        <div className="form-group">
          <label htmlFor="name">Full Name:</label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="email">Email Address:</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="phone">Phone Number:</label>
          <input
            type="tel"
            id="phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            required
          />
        </div>

        <button type="submit" className="booking-btn">Confirm Booking</button>
      </form>
    </div>
  );
};

export default Booking;
